message:
UPIANs, you can help Sendong victims thru Philippine Red Cross, simply text RED<space>AMOUNT and send to 2899 (Globe) or 4143 (Smart), http://www.mtgambrocio.com/typhoon-sendong/. You can donate in the following denominations;
Globe: 5, 25, 100, 300, 500 or 1000
Smart: 10, 25, 50, 100, 300, 500 or 1000
